import React from "react";

import classes from "./Input.module.css";

const Input = (props) => {
  return (
    <div className={classes.input}>
      <label>Amount:</label>
      <input
        type={props.type}
        id={props.id}
        min={props.min}
        max={props.max}
        defaultValue=""
      />
    </div>
  );
};

export default Input;
